import React from "react";

class Info extends React.Component {

    constructor(props){
        super(props);
    }

    render() {
        let myStyle = {
            fontsize: 25
        }
        return (
            <div>
                <div style={myStyle}>Denis Chaban, +7 952 909 42 33</div>
            </div>
        );
    }
}

export default Info;
